import React from "react";

interface Pos {
  x: number;
  y: number;
}

export const createMap = (content: string[]) => {
  const mountain: Pos[] = [];
  const treasure: Pos[] = [];

  content.map((c) => {
    const tmp = c.trim();
  });
  return [];
};
